import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import CreateCustomer from './omsComponents/CreateCustomer'
import ReadCustomer from './omsComponents/ReadCustomer'
import UpdateCustomer from './omsComponents/UpdateCustomer'

function App() {
  return (
    <div className="App">
    <BrowserRouter>
          <Routes>
              <Route></Route>
              <Route exact path="/createCustomer" element={<CreateCustomer/>} />
              <Route exact path="/readCustomer" element={<ReadCustomer/>} />
              <Route exact path="/updateCustomer" element={<UpdateCustomer/>} />
          </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
